import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

// Configuración global mejorada de Axios
const api = axios.create({
  baseURL: 'http://127.0.0.1:5001/api', // Usar 127.0.0.1 y puerto 5001
  timeout: 8000,
  headers: {
    'Content-Type': 'application/json',
    'Accept': 'application/json'
  }
});

// Interceptores para mejor manejo de errores
api.interceptors.request.use(config => {
  console.log(`Enviando petición a: ${config.url}`);
  return config;
}, error => {
  console.error('Error en la petición:', error);
  return Promise.reject(error);
});

api.interceptors.response.use(response => {
  console.log('Respuesta recibida:', response.status, response.data);
  return response;
}, error => {
  if (error.code === 'ECONNABORTED') {
    error.message = 'Timeout: El servidor no respondió a tiempo';
  } else if (!error.response) {
    error.message = 'Error de red: No se pudo conectar al servidor';
  }
  return Promise.reject(error);
});

function App() {
  const [bikes, setBikes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchBikes = async () => {
    try {
      setLoading(true);
      setError(null);

      // 1. Primero probamos conexión básica
      const testResponse = await api.get('/test');
      console.log('Conexión con backend OK:', testResponse.data);

      // 2. Obtenemos datos de bicicletas
      const bikesResponse = await api.get('/bikes');
      setBikes(bikesResponse.data);

    } catch (err) {
      console.error('Error en fetchBikes:', err);
      setError(err.message || 'Error al cargar datos');

      // Datos de ejemplo para desarrollo si el backend falla
      if (process.env.NODE_ENV === 'development') {
        setBikes([
          {
            id: 1,
            model: "Ejemplo Montaña",
            bike_type: "Montaña",
            price: 499.99,
            stock: 5
          },
          {
            id: 2,
            model: "Ejemplo Urbana",
            bike_type: "Urbana",
            price: 349.99,
            stock: 3
          }
        ]);
        setError('⚠ Usando datos de ejemplo (backend no disponible)');
      }
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchBikes();
  }, []);

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Cargando datos...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="error-container">
        <h2>Error</h2>
        <p>{error}</p>
        <button onClick={fetchBikes}>Reintentar</button>
      </div>
    );
  }

  return (
    <div className="App">
      <header>
        <h1>Tienda de Bicicletas</h1>
        <button onClick={fetchBikes} className="refresh-btn">
          Actualizar Datos
        </button>
      </header>

      <div className="bike-list-container">
        <h2>Inventario de Bicicletas</h2>

        <div className="stats">
          <p>Total de modelos: <strong>{bikes.length}</strong></p>
          <p>Total en stock: <strong>
            {bikes.reduce((sum, bike) => sum + bike.stock, 0)}
          </strong></p>
        </div>

        <table className="bike-table">
          <thead>
            <tr>
              <th>Modelo</th>
              <th>Tipo</th>
              <th>Precio (USD)</th>
              <th>Stock</th>
            </tr>
          </thead>
          <tbody>
            {bikes.map(bike => (
              <tr key={bike.id}>
                <td>{bike.model}</td>
                <td>{bike.bike_type}</td>
                <td>${bike.price.toFixed(2)}</td>
                <td className={bike.stock < 3 ? 'low-stock' : ''}>
                  {bike.stock}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
